define('../../../../../player/_base/js/scorm/initScorm',[], function() {
	
	var initScorm = function() {
		var config = Player.Config.general.scorm,
			wrapper = Player.Scorm.Wrapper;

		wrapper.doLMSInitialize();
		Player.Scorm.readScormVars();

		var suspendedData = Player.Scorm.getScormValue('cmi.suspend_data');

		// Player.Scorm.vars = {
		// 	"cmi.core.lesson_location": 0,
		// 	"cmi.core.lesson_status": "completed",
		// 	"cmi.core.score.raw": 0,
		// 	"cmi.suspend_data": {

		// 		

				
		// 
		// }

		// var suspendedData = Player.Scorm.getScormValue('cmi.suspend_data');



		for (var key in suspendedData) {
			if (key.indexOf('atividade') !== -1) {
				var atividade = Player.Helpers.findRecbyData('id', key),
					atv = $('#' + key),
					gabarito = suspendedData[key].gabarito,
					resps = suspendedData[key].respostas,
					tentativaPorQuestaoRealizada = suspendedData[key].tentativaPorQuestaoRealizada,
					scoAtividade = suspendedData[key].scoAtividade,
					certa = suspendedData[key].respostaCerta,
					feedBackVisual = atv.find(".chkOrRadio"),
					feedBackCircundado = suspendedData[key].feedBackCircundado,
					arrayTeste = ["0", "1", "2", "3", "4"];

				for (var i = resps.length - 1; i >= 0; i--) {
					atv.find('[value="' + resps[i] + '"]').prop("checked", true);
				}

				for (var i = 0; i < (feedBackVisual.length); i++) {

					var found = $.inArray(arrayTeste[i], gabarito);

					if (found === -1) {
						if (feedBackCircundado) {
							feedBackVisual[i].parentNode.parentNode.setAttribute("class", "errado");
						}
					} else {
						if (feedBackCircundado) {
							feedBackVisual[i].parentNode.parentNode.setAttribute("class", "certo");
						}
					}
				}

				if(scoAtividade == "comNota"){
					atv.find('.chkOrRadio').prop('disabled', true);
					atv.find('.enviaResposta').hide();
					atividade.tentativaPorQuestaoRealizada = tentativaPorQuestaoRealizada;
				}		
			}

			if(key === "acertos"){
				var totalAcertos = suspendedData[key].questoesCorretas;

				questoesCorretas = totalAcertos;
				console.log('TOTAL ACERTOSSSSSSSSSSS: ', totalAcertos);
			}


			if(key.indexOf('botaoPP') !== -1){

				var btsPP = suspendedData[key].btsPP;


					$('#'+btsPP).addClass('visualizado');
			


			}

		}

		$(window).on({
			beforeunload: function() {
				Player.Scorm.saveScormData(true);
			},

			unload: function() {
				Player.Scorm.saveScormData(true);
			}
		});

		console.log(Player);
	}

	return initScorm;
});

define('../../../../../player/_base/js/scorm/getScormValue',[], function() {

	var getScormValue = function(scormVar, susDataVar) {
		var scormVars = Player.Scorm.vars;

		for (var key in scormVars) {
			if (scormVars.hasOwnProperty(key)) {
				console.log(key, scormVar);
				if (key === scormVar) {
					if (scormVar === 'cmi.suspend_data' && susDataVar) {
						return scormVars[key][susDataVar];
					} else {
						return scormVars[key];
					}
					break;
				}
			}
		}
	}

	return getScormValue;
});

define('../../../../../player/_base/js/scorm/setScormValue',[], function() {
	var setScormValue = function(scormVar, value, susDataVar) {
		var scormVars = Player.Scorm.vars;

		for (var key in scormVars) {
			if (scormVars.hasOwnProperty(key)) {
				if (key === scormVar) {
					if (scormVar === 'cmi.suspend_data' && susDataVar) {
						scormVars[key][value] = susDataVar;
					} else if (scormVar === "cmi.core.lesson_location" && value > (Player.Tree.slides.length - 1)) {
						scormVars[key] = Player.Tree.slides.length - 1;
					} else {
						scormVars[key] = value;
					}
					break;
				}
			}
		}
	}

	return setScormValue;
});

define('../../../../../player/_base/js/scorm/readScormVars',[], function() {
	var readScormVars = function() {
		Player.Scorm.vars = Player.Scorm.vars ? Player.Scorm.vars : {};
		Player.Scorm.info = Player.Scorm.info ? Player.Scorm.info : {};
		Player.Scorm.info.startTime = new Date().getTime();

		var scormVars = Player.Config.general.scorm.vars,
			getValue = Player.Scorm.Wrapper.doLMSGetValue;

		console.log('scormVars---------', scormVars);
		for (var i = scormVars.length - 1; i >= 0; i--) {
			if (scormVars[i]) {
				var value = getValue(scormVars[i]);
				if (scormVars[i] === "cmi.suspend_data") {
					if (!Player.Helpers.isJSON(value) && value === "") {
						Player.Scorm.vars[scormVars[i]] = {};
					} else {
						Player.Scorm.vars[scormVars[i]] = jQuery.parseJSON(value);
					}
				} else if (scormVars[i] === "cmi.core.lesson_location" && value > (Player.Tree.slides.length - 1)) {
					Player.Scorm.vars[scormVars[i]] = Player.Tree.slides.length - 1;

				} else {
					Player.Scorm.vars[scormVars[i]] = value;
				}

			}
		};
	}

	return readScormVars;
});

define('../../../../../player/_base/js/scorm/saveScormData',[], function() {

	function addslashes(str) {
		return (str + '')
			.replace(/[\\"']/g, '\\$&')
			.replace(/\u0000/g, '\\0');
	}

	var saveScormData = function(finaliza) {
		var scormWrapper = Player.Scorm.Wrapper,
			setValue = scormWrapper.doLMSSetValue,
			scormVars = Player.Scorm.vars;

		console.log(scormVars);
		for (var key in scormVars) {
			if (scormVars.hasOwnProperty(key)) {
				// chamar 2 vezes o addslashes no EPM Volks
				var valor = key === "cmi.suspend_data" && scormVars[key] !== "" ? addslashes(addslashes(JSON.stringify(scormVars[key]))) : scormVars[key];
				// var valor = scormVars[key].value;
				if (valor) {
					setValue(key, valor);

					console.log(key, valor);
				}
			}
		}

		scormWrapper.computeTime(Player.Scorm.info.startTime);
		scormWrapper.doLMSCommit();

		if (finaliza) {
			Player.Scorm.endScorm();
		}
	}

	return saveScormData;
});

define('../../../../../player/_base/js/scorm/endScorm',[], function() {

	var endScorm = function() {
		Player.Scorm.Wrapper.doLMSFinish();
		Player.Scorm.info.finalizado = true;
	}

	return endScorm;
});


