define('../../../../../player/_base/js/helpers/sortByProperty',[
    'jquery'
    ], function($) {

	var sortByProperty = function(prop, arr) {
		prop = prop.split('.');
		var len = prop.length;

		arr.sort(function(a, b) {
			var i = 0;
			while (i < len) {
				a = a[prop[i]];
				b = b[prop[i]];
				i++;
			}
			if (a < b) {
				return -1;
			} else if (a > b) {
				return 1;
			} else {
				return 0;
			}
		});
		return arr;
	};

	return sortByProperty;
});

